import { createApp } from 'vue';
import App from './App.vue';
import router from './router'; // Assurez-vous que le chemin est correct
import vuetify from './plugins/vuetify';


const app = createApp(App);

app.use(router);

app.mount('#app');


new Vue({
    vuetify,
    // autres options...
  }).$mount('#app');
